toObject.code:
function toObject(array) {
    let result = {};
    if (array && Array.isArray(array)) {
        array.forEach(field => {
            if (field.name && field.value) {
                result[field.name] = field.value;
            }
        });
    }
    return result;
}

formatRows.code:
function formatRows(rows) {
    if (rows && Array.isArray(rows)) {
        return rows.map(iml.toObject);
    }
}
